  false,\n\t\"url\": null,\n\t\"notes\": \"The Electron Density Profile, N(h), data
  set contains both individual profiles and composite months. The data consist of
  virtual height/frequency pairs from a profile or profiles (composite months) of
  ionograms. Data includes the station, year, month and hour (or composite month)
  for each record. Data are available on 9-track magnetic tape. Electron density profiles
  are also available in Dataset_ID: G10145. The stations included are Argentia, Bermuda,n
  \                   College, Dyess, Goose Bay, Narssarssuaq, Puerto Rico, Sondestrom,
  Thule, and Wallops Island.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
